  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides information on hotel/motel
  taxes collected by jurisdiction, tax year and quarter starting with tax year 2000.
  \ The hotel/motel tax is imposed on the gross receipts from the renting of sleeping
  rooms, apartments, or sleeping quarters in any: hotel, motel, inn, public lodging
  house, rooming house, tourist court, bed-and-breakfast, or in any place where sleeping
  accommodations are furnished to transient guestsrn...when contracted for periods
  of 31 consecutive days or less.  Contracts for periods of more than 31 consecutive
  days are exempt. To qualify, the renter must contract to rent for a single period
  of more than 31 days and cannot accumulate these days.  The tax base must include
  the entire cost related to the rental of the room. If a person is charged for other
  items when renting a room, the charges must be stated separately or the entire amount
  will be subject to the hotel/motel tax.  Hotel/motel tax is reported and remitted
  with the quarterly sales tax to the Iowa Department of Revenue.\",\n\t\"license_title\":
